struct RoboBeeAPI
{
  using Workspace = OSQPWorkspace;

  // Get the global workspace instance (initialized on first use)
  static Workspace* get_workspace() {
    // Static flag to track if workspace is initialized
    static bool initialized = false;
    // This workspace is initialized via embedded C code
    static Workspace* workspace = nullptr;
    
    if (!initialized) {
      // Create and initialize the workspace only once
      workspace = osqp_workspace_create();
      if (workspace) {
        init(workspace);
        initialized = true;
      }
    }
    return workspace;
  }

  static inline void init(Workspace* w) { robobee_init(w); }

  static inline void update_rhs(Workspace* w,
                                const float* x0,
                                const float* xref)
  {
    float b[200];
    for (int k = 0; k < 200; ++k) {
      float acc = 0.f;
      for (int i = 0; i < 10; ++i)
        acc += robobee_Phi[k][i] * x0[i];
      b[k] = xref[k] - acc;
    }
    robobee_update_bounds(w, b, b);
  }

  // Warm start the solver with a previous solution
  static inline void warm_start(Workspace* w, const float* u_warm)
  {
    osqp_warm_start_x(w, u_warm);
  }

  // Get the solution (optimal control inputs)
  static inline const float* get_solution(Workspace* w) {
    return osqp_get_primal_solution(w);
  }

  static inline void solve(Workspace* w) { robobee_solve(w); }

  // Get the solver status
  static inline int get_status(Workspace* w) {
    return osqp_get_status_val(w);
  }

  // Check if the solver solution is optimal
  static inline bool is_optimal(Workspace* w) {
    int status = get_status(w);
    return status == OSQP_SOLVED || status == OSQP_SOLVED_INACCURATE;
  }

  // Get iteration count
  static inline int get_iter_count(Workspace* w) {
    return osqp_get_iter(w);
  }

  static constexpr int n_x = 10;
  static constexpr int n_u = 3;
  static constexpr int horizon = 20;
};
#endif //ENTO_CONTROL_ROBOBEE_API
